@testset "5.1.4 (f x)^m (d+e x^2)^p (a+b arcsin(c x))^n" begin
    @variables a, b, c, d, e, f, m, n, x

    #= ::Package:: =#

    #= ::Title::Closed:: =#
    #=Integrands*of*the*form*(f*x)^m*(d-c^2*d*x^2)^p*(a+b*asin(c*x))^n=#


    #= ::Section::Closed:: =#
    #=Integrands*of*the*form*(f*x)^m*(d-c^2*d*x^2)^p*(a+b*asin(c*x))^1=#


    #= ::Subsection::Closed:: =#
    #=Integrands*of*the*form*(f*x)^m*(d-c^2*d*x^2)^p*(a+b*asin(c*x)=#


    #= ::Subsubsection::Closed:: =#
    #=p>0=#


    @test_int [x^4*(d - c^2*d*x^2)*(a + b*asin(c*x)), x, 5, (2*b*d*sqrt(1 - c^2*x^2))/(35*c^5) + (b*d*(1 - c^2*x^2)^(3/2))/(105*c^5) - (8*b*d*(1 - c^2*x^2)^(5/2))/(175*c^5) + (b*d*(1 - c^2*x^2)^(7/2))/(49*c^5) + (1/5)*d*x^5*(a + b*asin(c*x)) - (1/7)*c^2*d*x^7*(a + b*asin(c*x))]
    @test_int [x^3*(d - c^2*d*x^2)*(a + b*asin(c*x)), x, 6, (b*d*x*sqrt(1 - c^2*x^2))/(24*c^3) + (b*d*x^3*sqrt(1 - c^2*x^2))/(36*c) - (1/36)*b*c*d*x^5*sqrt(1 - c^2*x^2) - (b*d*asin(c*x))/(24*c^4) + (1/4)*d*x^4*(a + b*asin(c*x)) - (1/6)*c^2*d*x^6*(a + b*asin(c*x))]
    @test_int [x^2*(d - c^2*d*x^2)*(a + b*asin(c*x)), x, 5, (2*b*d*sqrt(1 - c^2*x^2))/(15*c^3) + (b*d*(1 - c^2*x^2)^(3/2))/(45*c^3) - (b*d*(1 - c^2*x^2)^(5/2))/(25*c^3) + (1/3)*d*x^3*(a + b*asin(c*x)) - (1/5)*c^2*d*x^5*(a + b*asin(c*x))]
    @test_int [x^1*(d - c^2*d*x^2)*(a + b*asin(c*x)), x, 4, (3*b*d*x*sqrt(1 - c^2*x^2))/(32*c) + (b*d*x*(1 - c^2*x^2)^(3/2))/(16*c) + (3*b*d*asin(c*x))/(32*c^2) - (d*(1 - c^2*x^2)^2*(a + b*asin(c*x)))/(4*c^2)]
    @test_int [x^0*(d - c^2*d*x^2)*(a + b*asin(c*x)), x, 5, (2*b*d*sqrt(1 - c^2*x^2))/(3*c) + (b*d*(1 - c^2*x^2)^(3/2))/(9*c) + d*x*(a + b*asin(c*x)) - (1/3)*c^2*d*x^3*(a + b*asin(c*x))]
    @test_int [((d - c^2*d*x^2)*(a + b*asin(c*x)))/x^1, x, 8, (-(1/4))*b*c*d*x*sqrt(1 - c^2*x^2) - (1/4)*b*d*asin(c*x) + (1/2)*d*(1 - c^2*x^2)*(a + b*asin(c*x)) - (im*d*(a + b*asin(c*x))^2)/(2*b) + d*(a + b*asin(c*x))*log(1 - ℯ^(2*im*asin(c*x))) - (1/2)*im*b*d*PolyLog(2, ℯ^(2*im*asin(c*x)))]
    @test_int [((d - c^2*d*x^2)*(a + b*asin(c*x)))/x^2, x, 6, (-b)*c*d*sqrt(1 - c^2*x^2) - (d*(a + b*asin(c*x)))/x - c^2*d*x*(a + b*asin(c*x)) - b*c*d*atanh(sqrt(1 - c^2*x^2))]
    @test_int [((d - c^2*d*x^2)*(a + b*asin(c*x)))/x^3, x, 8, -((b*c*d*sqrt(1 - c^2*x^2))/(2*x)) - (1/2)*b*c^2*d*asin(c*x) - (d*(1 - c^2*x^2)*(a + b*asin(c*x)))/(2*x^2) + (im*c^2*d*(a + b*asin(c*x))^2)/(2*b) - c^2*d*(a + b*asin(c*x))*log(1 - ℯ^(2*im*asin(c*x))) + (1/2)*im*b*c^2*d*PolyLog(2, ℯ^(2*im*asin(c*x)))]
    @test_int [((d - c^2*d*x^2)*(a + b*asin(c*x)))/x^4, x, 6, -((b*c*d*sqrt(1 - c^2*x^2))/(6*x^2)) - (d*(a + b*asin(c*x)))/(3*x^3) + (c^2*d*(a + b*asin(c*x)))/x + (5/6)*b*c^3*d*atanh(sqrt(1 - c^2*x^2))]


    @test_int [x^4*(d - c^2*d*x^2)^2*(a + b*asin(c*x)), x, 6, (8*b*d^2*sqrt(1 - c^2*x^2))/(315*c^5) + (4*b*d^2*(1 - c^2*x^2)^(3/2))/(945*c^5) + (b*d^2*(1 - c^2*x^2)^(5/2))/(525*c^5) - (10*b*d^2*(1 - c^2*x^2)^(7/2))/(441*c^5) + (b*d^2*(1 - c^2*x^2)^(9/2))/(81*c^5) + (1/5)*d^2*x^5*(a + b*asin(c*x)) - (2/7)*c^2*d^2*x^7*(a + b*asin(c*x)) + (1/9)*c^4*d^2*x^9*(a + b*asin(c*x))]
    @test_int [x^3*(d - c^2*d*x^2)^2*(a + b*asin(c*x)), x, 7, (73*b*d^2*x*sqrt(1 - c^2*x^2))/(3072*c^3) + (73*b*d^2*x^3*sqrt(1 - c^2*x^2))/(4608*c) - (43*b*c*d^2*x^5*sqrt(1 - c^2*x^2))/1152 + (1/64)*b*c^3*d^2*x^7*sqrt(1 - c^2*x^2) - (73*b*d^2*asin(c*x))/(3072*c^4) + (1/4)*d^2*x^4*(a + b*asin(c*x)) - (1/3)*c^2*d^2*x^6*(a + b*asin(c*x)) + (1/8)*c^4*d^2*x^8*(a + b*asin(c*x))]
    @test_int [x^2*(d - c^2*d*x^2)^2*(a + b*asin(c*x)), x, 5, (8*b*d^2*sqrt(1 - c^2*x^2))/(105*c^3) + (4*b*d^2*(1 - c^2*x^2)^(3/2))/(315*c^3) + (b*d^2*(1 - c^2*x^2)^(5/2))/(175*c^3) - (b*d^2*(1 - c^2*x^2)^(7/2))/(49*c^3) + (1/3)*d^2*x^3*(a + b*asin(c*x)) - (2/5)*c^2*d^2*x^5*(a + b*asin(c*x)) + (1/7)*c^4*d^2*x^7*(a + b*asin(c*x))]
    @test_int [x^1*(d - c^2*d*x^2)^2*(a + b*asin(c*x)), x, 5, (5*b*d^2*x*sqrt(1 - c^2*x^2))/(96*c) + (5*b*d^2*x*(1 - c^2*x^2)^(3/2))/(144*c) + (b*d^2*x*(1 - c^2*x^2)^(5/2))/(36*c) + (5*b*d^2*asin(c*x))/(96*c^2) - (d^2*(1 - c^2*x^2)^3*(a + b*asin(c*x)))/(6*c^2)]
    @test_int [x^0*(d - c^2*d*x^2)^2*(a + b*asin(c*x)), x, 5, (8*b*d^2*sqrt(1 - c^2*x^2))/(15*c) + (4*b*d^2*(1 - c^2*x^2)^(3/2))/(45*c) + (b*d^2*(1 - c^2*x^2)^(5/2))/(25*c) + d^2*x*(a + b*asin(c*x)) - (2/3)*c^2*d^2*x^3*(a + b*asin(c*x)) + (1/5)*c^4*d^2*x^5*(a + b*asin(c*x))]
    @test_int [((d - c^2*d*x^2)^2*(a + b*asin(c*x)))/x^1, x, 12, (-(11/32))*b*c*d^2*x*sqrt(1 - c^2*x^2) - (1/16)*b*c*d^2*x*(1 - c^2*x^2)^(3/2) - (11/32)*b*d^2*asin(c*x) + (1/2)*d^2*(1 - c^2*x^2)*(a + b*asin(c*x)) + (1/4)*d^2*(1 - c^2*x^2)^2*(a + b*asin(c*x)) - (im*d^2*(a + b*asin(c*x))^2)/(2*b) + d^2*(a + b*asin(c*x))*log(1 - ℯ^(2*im*asin(c*x))) - (1/2)*im*b*d^2*PolyLog(2, ℯ^(2*im*asin(c*x)))]
    @test_int [((d - c^2*d*x^2)^2*(a + b*asin(c*x)))/x^2, x, 7, (-(5/3))*b*c*d^2*sqrt(1 - c^2*x^2) - (1/9)*b*c*d^2*(1 - c^2*x^2)^(3/2) - (d^2*(a + b*asin(c*x)))/x - 2*c^2*d^2*x*(a + b*asin(c*x)) + (1/3)*c^4*d^2*x^3*(a + b*asin(c*x)) - b*c*d^2*atanh(sqrt(1 - c^2*x^2))]
    @test_int [((d - c^2*d*x^2)^2*(a + b*asin(c*x)))/x^3, x, 12, (-(1/4))*b*c^3*d^2*x*sqrt(1 - c^2*x^2) - (b*c*d^2*(1 - c^2*x^2)^(3/2))/(2*x) - (1/4)*b*c^2*d^2*asin(c*x) - c^2*d^2*(1 - c^2*x^2)*(a + b*asin(c*x)) - (d^2*(1 - c^2*x^2)^2*(a + b*asin(c*x)))/(2*x^2) + (im*c^2*d^2*(a + b*asin(c*x))^2)/b - 2*c^2*d^2*(a + b*asin(c*x))*log(1 - ℯ^(2*im*asin(c*x))) + im*b*c^2*d^2*PolyLog(2, ℯ^(2*im*asin(c*x)))]
    @test_int [((d - c^2*d*x^2)^2*(a + b*asin(c*x)))/x^4, x, 7, b*c^3*d^2*sqrt(1 - c^2*x^2) - (b*c*d^2*sqrt(1 - c^2*x^2))/(6*x^2) - (d^2*(a + b*asin(c*x)))/(3*x^3) + (2*c^2*d^2*(a + b*asin(c*x)))/x + c^4*d^2*x*(a + b*asin(c*x)) + (11/6)*b*c^3*d^2*atanh(sqrt(1 - c^2*x^2))]


    @test_int [x^4*(d - c^2*d*x^2)^3*(a + b*asin(c*x)), x, 5, (16*b*d^3*sqrt(1 - c^2*x^2))/(1155*c^5) + (8*b*d^3*(1 - c^2*x^2)^(3/2))/(3465*c^5) + (2*b*d^3*(1 - c^2*x^2)^(5/2))/(1925*c^5) + (b*d^3*(1 - c^2*x^2)^(7/2))/(1617*c^5) - (4*b*d^3*(1 - c^2*x^2)^(9/2))/(297*c^5) + (b*d^3*(1 - c^2*x^2)^(11/2))/(121*c^5) + (1/5)*d^3*x^5*(a + b*asin(c*x)) - (3/7)*c^2*d^3*x^7*(a + b*asin(c*x)) + (1/3)*c^4*d^3*x^9*(a + b*asin(c*x)) - (1/11)*c^6*d^3*x^11*(a + b*asin(c*x))]
    @test_int [x^3*(d - c^2*d*x^2)^3*(a + b*asin(c*x)), x, 8, (49*b*d^3*x*sqrt(1 - c^2*x^2))/(5120*c^3) + (49*b*d^3*x*(1 - c^2*x^2)^(3/2))/(7680*c^3) + (49*b*d^3*x*(1 - c^2*x^2)^(5/2))/(9600*c^3) + (7*b*d^3*x*(1 - c^2*x^2)^(7/2))/(1600*c^3) - (b*d^3*x*(1 - c^2*x^2)^(9/2))/(100*c^3) + (49*b*d^3*asin(c*x))/(5120*c^4) - (d^3*(1 - c^2*x^2)^4*(a + b*asin(c*x)))/(8*c^4) + (d^3*(1 - c^2*x^2)^5*(a + b*asin(c*x)))/(10*c^4)]
    @test_int [x^2*(d - c^2*d*x^2)^3*(a + b*asin(c*x)), x, 5, (16*b*d^3*sqrt(1 - c^2*x^2))/(315*c^3) + (8*b*d^3*(1 - c^2*x^2)^(3/2))/(945*c^3) + (2*b*d^3*(1 - c^2*x^2)^(5/2))/(525*c^3) + (b*d^3*(1 - c^2*x^2)^(7/2))/(441*c^3) - (b*d^3*(1 - c^2*x^2)^(9/2))/(81*c^3) + (1/3)*d^3*x^3*(a + b*asin(c*x)) - (3/5)*c^2*d^3*x^5*(a + b*asin(c*x)) + (3/7)*c^4*d^3*x^7*(a + b*asin(c*x)) - (1/9)*c^6*d^3*x^9*(a + b*asin(c*x))]
    @test_int [x^1*(d - c^2*d*x^2)^3*(a + b*asin(c*x)), x, 6, (35*b*d^3*x*sqrt(1 - c^2*x^2))/(1024*c) + (35*b*d^3*x*(1 - c^2*x^2)^(3/2))/(1536*c) + (7*b*d^3*x*(1 - c^2*x^2)^(5/2))/(384*c) + (b*d^3*x*(1 - c^2*x^2)^(7/2))/(64*c) + (35*b*d^3*asin(c*x))/(1024*c^2) - (d^3*(1 - c^2*x^2)^4*(a + b*asin(c*x)))/(8*c^2)]
    @test_int [x^0*(d - c^2*d*x^2)^3*(a + b*asin(c*x)), x, 5, (16*b*d^3*sqrt(1 - c^2*x^2))/(35*c) + (8*b*d^3*(1 - c^2*x^2)^(3/2))/(105*c) + (6*b*d^3*(1 - c^2*x^2)^(5/2))/(175*c) + (b*d^3*(1 - c^2*x^2)^(7/2))/(49*c) + d^3*x*(a + b*asin(c*x)) - c^2*d^3*x^3*(a + b*asin(c*x)) + (3/5)*c^4*d^3*x^5*(a + b*asin(c*x)) - (1/7)*c^6*d^3*x^7*(a + b*asin(c*x))]
    @test_int [((d - c^2*d*x^2)^3*(a + b*asin(c*x)))/x^1, x, 17, (-(19/48))*b*c*d^3*x*sqrt(1 - c^2*x^2) - (7/72)*b*c*d^3*x*(1 - c^2*x^2)^(3/2) - (1/36)*b*c*d^3*x*(1 - c^2*x^2)^(5/2) - (19/48)*b*d^3*asin(c*x) + (1/2)*d^3*(1 - c^2*x^2)*(a + b*asin(c*x)) + (1/4)*d^3*(1 - c^2*x^2)^2*(a + b*asin(c*x)) + (1/6)*d^3*(1 - c^2*x^2)^3*(a + b*asin(c*x)) - (im*d^3*(a + b*asin(c*x))^2)/(2*b) + d^3*(a + b*asin(c*x))*log(1 - ℯ^(2*im*asin(c*x))) - (1/2)*im*b*d^3*PolyLog(2, ℯ^(2*im*asin(c*x)))]
    @test_int [((d - c^2*d*x^2)^3*(a + b*asin(c*x)))/x^2, x, 7, (-(11/5))*b*c*d^3*sqrt(1 - c^2*x^2) - (1/5)*b*c*d^3*(1 - c^2*x^2)^(3/2) - (1/25)*b*c*d^3*(1 - c^2*x^2)^(5/2) - (d^3*(a + b*asin(c*x)))/x - 3*c^2*d^3*x*(a + b*asin(c*x)) + c^4*d^3*x^3*(a + b*asin(c*x)) - (1/5)*c^6*d^3*x^5*(a + b*asin(c*x)) - b*c*d^3*atanh(sqrt(1 - c^2*x^2))]
    @test_int [((d - c^2*d*x^2)^3*(a + b*asin(c*x)))/x^3, x, 17, (3/32)*b*c^3*d^3*x*sqrt(1 - c^2*x^2) - (7/16)*b*c^3*d^3*x*(1 - c^2*x^2)^(3/2) - (b*c*d^3*(1 - c^2*x^2)^(5/2))/(2*x) + (3/32)*b*c^2*d^3*asin(c*x) - (3/2)*c^2*d^3*(1 - c^2*x^2)*(a + b*asin(c*x)) - (3/4)*c^2*d^3*(1 - c^2*x^2)^2*(a + b*asin(c*x)) - (d^3*(1 - c^2*x^2)^3*(a + b*asin(c*x)))/(2*x^2) + (3*im*c^2*d^3*(a + b*asin(c*x))^2)/(2*b) - 3*c^2*d^3*(a + b*asin(c*x))*log(1 - ℯ^(2*im*asin(c*x))) + (3/2)*im*b*c^2*d^3*PolyLog(2, ℯ^(2*im*asin(c*x)))]
    @test_int [((d - c^2*d*x^2)^3*(a + b*asin(c*x)))/x^4, x, 8, (8/3)*b*c^3*d^3*sqrt(1 - c^2*x^2) - (b*c*d^3*sqrt(1 - c^2*x^2))/(6*x^2) + (1/9)*b*c^3*d^3*(1 - c^2*x^2)^(3/2) - (d^3*(a + b*asin(c*x)))/(3*x^3) + (3*c^2*d^3*(a + b*asin(c*x)))/x + 3*c^4*d^3*x*(a + b*asin(c*x)) - (1/3)*c^6*d^3*x^3*(a + b*asin(c*x)) + (17/6)*b*c^3*d^3*atanh(sqrt(1 - c^2*x^2))]


    #= ::Subsubsection::Closed:: =#
    #=p<0=#


    @test_int [x^4*(a + b*asin(c*x))/(d - c^2*d*x^2), x, 12, -((4*b*sqrt(1 - c^2*x^2))/(3*c^5*d)) + (b*(1 - c^2*x^2)^(3/2))/(9*c^5*d) - (x*(a + b*asin(c*x)))/(c^4*d) - (x^3*(a + b*asin(c*x)))/(3*c^2*d) - (2*im*(a + b*asin(c*x))*atan(ℯ^(im*asin(c*x))))/(c^5*d) + (im*b*PolyLog(2, (-im)*ℯ^(im*asin(c*x))))/(c^5*d) - (im*b*PolyLog(2, im*ℯ^(im*asin(c*x))))/(c^5*d)]
    @test_int [x^3*(a + b*asin(c*x))/(d - c^2*d*x^2), x, 8, -(b*x*sqrt(1 - c^2*x^2))/(4*c^3*d) + (b*asin(c*x))/(4*c^4*d) - (x^2*(a + b*asin(c*x)))/(2*c^2*d) + ((im/2)*(a + b*asin(c*x))^2)/(b*c^4*d) - ((a + b*asin(c*x))*log(1 + ℯ^((2*im)*asin(c*x))))/(c^4*d) + ((im/2)*b*PolyLog(2, -ℯ^((2*im)*asin(c*x))))/(c^4*d)]
    @test_int [x^2*(a + b*asin(c*x))/(d - c^2*d*x^2), x, 8, -((b*sqrt(1 - c^2*x^2))/(c^3*d)) - (x*(a + b*asin(c*x)))/(c^2*d) - ((2*im)*(a + b*asin(c*x))*atan(ℯ^(im*asin(c*x))))/(c^3*d) + (im*b*PolyLog(2, (-im)*ℯ^(im*asin(c*x))))/(c^3*d) - (im*b*PolyLog(2, im*ℯ^(im*asin(c*x))))/(c^3*d)]
    @test_int [x^1*(a + b*asin(c*x))/(d - c^2*d*x^2), x, 5, ((im/2)*(a + b*asin(c*x))^2)/(b*c^2*d) - ((a + b*asin(c*x))*log(1 + ℯ^((2*im)*asin(c*x))))/(c^2*d) + ((im/2)*b*PolyLog(2, -ℯ^((2*im)*asin(c*x))))/(c^2*d)]
    @test_int [x^0*(a + b*asin(c*x))/(d - c^2*d*x^2), x, 6, ((-2*im)*(a + b*asin(c*x))*atan(ℯ^(im*asin(c*x))))/(c*d) + (im*b*PolyLog(2, (-im)*ℯ^(im*asin(c*x))))/(c*d) - (im*b*PolyLog(2, im*ℯ^(im*asin(c*x))))/(c*d)]
    @test_int [(a + b*asin(c*x))/(x^1*(d - c^2*d*x^2)), x, 7, -((2*(a + b*asin(c*x))*atanh(ℯ^(2*im*asin(c*x))))/d) + (im*b*PolyLog(2, -ℯ^(2*im*asin(c*x))))/(2*d) - (im*b*PolyLog(2, ℯ^(2*im*asin(c*x))))/(2*d)]
